import {useState} from 'react';
import './App.css';

// Create a component and asign it atributtes with props

const Person = (props) => {
  return(
    <>
      <h1>Name: {props.name}</h1>
    </>
  )
}

const App = () => {
  // This need to be out of the return
  const name = 'Patrick';

  const [Name, setName] = useState();

  return (
    <div className="App">
      <h1>Hello! {1-1}</h1>
      {name ? (
        <>
          <Person name={name}/>
        </>
      ):(
        <>
          <h1>There is no name.</h1>
        </>
      )}
      <button onClick={() => setName('Jenny')}></button>
    </div>
  );
}

export default App;
